import{_ as c}from"./chunks/index.VAya1KE4.js";import{c as a,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":378,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":378,"name":"猫又","summary":"猫宫 又奈","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/31/79697369/e926c03ff8172cfc3a010cfcbe76d238_6884319312264072107.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/09e884cb1e270257ec699c2adad1a67d_9192736123691865439.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/9e764218f1ad6d1e33c0c13dfe4746c4_8151688314244376329.png"},"attrs":[["稀有度","S"],["属性","物理"],["特性","强攻"],["阵营","狡兔屋"]],"destiny":[["LEVEL1猎鸟技巧","从背后攻击命中敌人时，猫又无视目标16%物理伤害抗性；敌方处于失衡状态时，猫又对其发动的所有攻击均被视为背后攻击。娇小的猫又并没有强大的膂力，取而代之的是捕捉对手弱点的眼光，和准确攻击弱点的迅敏。"],["LEVEL2猫鼠游戏","当场上只有一名敌人且自身位于前场时，猫又的能量获得效率提升25%。猫咪们总是更喜欢玩弄猎物。当场上的「老鼠」只剩一只时，就是独属于她的玩乐时光了。"],["LEVEL3好奇的左尾","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2在旧文明的传说里，一根尾巴代表猫的一条命，里面寄宿着多年的生存智慧…这话是假的，但猫又积累的街头生存经验确实是真的。"],["LEVEL4磨爪 ","发动[强化特殊技]时，猫又的暴击率提升7%，最多叠加2层，持续15秒，每层效果单独结算持续时间。「多来点多来点！我全~部都能消化掉哟！」猫希人舔了舔爪子，眼睛亮晶晶的。"],["LEVEL5幸运的右尾 ","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2在旧文明的传说里，一根尾巴代表猫的一条命，里面寄宿着多年的生存智慧…有时候猫又也会好奇，如果自己能继续幸运地活下去，是不是还会长出新尾巴？"],["LEVEL6捕食者血统 ","发动[连携技]或[终结技]时，猫又的暴击伤害提升18%，最多叠加3层，退出接战状态时增益效果结束，猫又击败敌人时，该增益效果直接叠加至层数上限。「对猫希人来说，因攻击行为而获得的正向反馈，极有可能触发他们性格中所潜藏的暴力倾向。幸运的是，这种倾向似乎并不具有永久性效果…」摘自一本破旧的《猫希人不完全研究手册》"]],"skill":[{"title":"普通攻击：猫猫爪刺","desc":"点按发动：向前方进行至多五段的斩击，造成物理伤害；发动最后一段斩击时，有33.33%的概率重复攻击三次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/24/79697369/81d5cb8f235fb94b4193860e58103fc8_1068169258849130334.gif"},{"title":"普通攻击：赤色之刃","desc":"在[普通攻击]前三段中，长按发动；向前方进行斩击，可穿过前方敌人，并对其造成物理伤害；招式发动时，有33.33%的概率重复攻击三次。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/16163898212c8c44abf75870ecba6aba_6970266014067023577.gif"},{"title":"闪避：打不着喵~","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/b82d9a2cca713a9eb7b1412b076d81b0_1905382137937427795.gif"},{"title":"冲刺攻击：你在看哪边？","desc":"闪避时，点按发动：向前方进行斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/2df818f98c580f52777000751d6680be_755140038051069573.gif"},{"title":"闪避反击：虚影双刺 ","desc":"触发[极限闪避]后，点按发动：对前方敌人发动斩击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/c07f6f1af68ea6153aa3c467535fe339_5414603894931582452.gif"},{"title":"快速支援：借用猫爪","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动斩击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/80dfb764e233f96d07ef6f9294cb3e95_5928263421127146087.gif"},{"title":"招架支援：应激防御","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/bd4722303a3ce404acb6814bdd52dd4f_6424670260506849208.gif"},{"title":"支援突击：迅影","desc":"发动[招架支援]后，点按发动：对前方敌人发动突进斩击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/c8f783c6e7d4d4a9eff47d8ccfb6b7ca_575972638220245510.gif"},{"title":"特殊技：奇袭","desc":"点按发动：向前方进行下落打击，造成物理伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/05c53fafd2ac9b0aedb441feb7a9a9a9_4409528141446289162.gif"},{"title":"强化特殊技：超~凶奇袭！","desc":"能量足够时，点按发动：向前方进行强力下落斩击，造成大量物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/4a2004fe5a5b2125698d5ab620ca0386_2086784902400127467.gif"},{"title":"连携技：刃爪挥击","desc":"触发[连携技]时，选择对应角色发动：对前方大范围敌人发动强力斩击，造成大量物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/5aba100f47e53fdfc310bc8d654c8780_2756540202955765367.gif"},{"title":"终结技：刃爪强袭","desc":"喧响等级达到[极]时，点按发动：对前方大范围敌人发动强力斩击，造成大量物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/15559334/71c2965e662ff606b748a4d070f1e5e1_2438340688841799081.gif"},{"title":"核心技","desc":"核心被动：猫步诡影猫又发动[闪避反击]或[快速支援]命中敌人时，自身造成的伤害提升30%，持续6秒。（此处数据为初始数据）额外能力：猫步秀队伍中存在于自身属性或阵营相同的角色时触发：队伍中任意角色对敌人施加[强击]效果后，猫又下一次发动[强化特殊技]时，招式造成的伤害提升35%，最多叠加2层。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/03/34600917/7d95452309cc4f875c20d6f2186cc494_6515665421545381592.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/378.md","filePath":"game/zzz/role/[pkg].md"}'),i={name:"game/zzz/role/378.md"},_=Object.assign(i,{setup(d){return(p,n)=>(o(),a("div",null,[e(t(c))]))}});export{b as __pageData,_ as default};
